import React from "react";
import { FiMail } from "react-icons/fi";
import { Link } from "react-router-dom";

const CallToAction = ({ serviceStyle, textAlign }) => {
  return (
    <div
      className="rn-callto-action clltoaction-style-default style-2 bg_image bg_image_fixed"
      style={{ backgroundImage: `url(/images/timeline/subs1.jpg)` }}
      data-black-overlay="8"
    >
      <div className="col-lg-4 col-md-6 col-sm-6 col-12">
        <div className={`service ${serviceStyle} ${textAlign}`}>
          <div className="inner">
            <div className="image">
              <img
                src={`/images/ihelp/magazine.png`}
                alt="card Images"
                style={{ borderRadius: "20px" }}
              />
            </div>
            <div className="content">
              <h4 className="title" style={{ color: "#fff" }}>
                <Link
                  to="#service"
                  dangerouslySetInnerHTML={{
                    __html: "Уншигч танд <br/> зориулав",
                  }}
                ></Link>
              </h4>
              <p
                className="description b1 color-gray "
                dangerouslySetInnerHTML={{
                  __html:
                    "Өөрийгөө хөгжүүлэх хэрэгцээт, цаг үеийн чанартай контентүүдыг тогтмол хүлээн аваарай",
                }}
              ></p>
              <form
                className="blog-search"
                action="#"
                // onSubmit={handleAddMagazineSubmit}
              >
                <input
                  type="text"
                  name="name"
                  //   onChange={handleAddMagazineSubs}
                  placeholder="И-мэйл хаягаа бичнэ үү  "
                />
                <button className="search-button" type="submit">
                  <FiMail />
                </button>
              </form>
            </div>
          </div>
        </div>
      </div>
    </div>
  );
};
export default CallToAction;
